import React from 'react';
import ClassicalSearchHeader from './ClassicalSearchHeader';
import YouTubeEmbed from '../../components/youtube-embed/YouTubeEmbed';
import ClassicalCheckboxes from '../../components/check-box/ClassicalCheckboxes';
import ClassicalCardList from '../../components/collection-card/ClassicalCardList';
import { classicalinfo } from './classicalinfo';
import './ClassicalYoutubePageStyles.scss';


const ClassicalYTpage = () => {
	return(
		<div>
			<ClassicalSearchHeader />
			<div className='youtube_container'>
				<YouTubeEmbed />
			</div>
			<div className='ckeckbox_container'>
				<ClassicalCheckboxes />
			</div>
			<div className='card-section'>
				<ClassicalCardList classicalinfo={classicalinfo} />
			</div>
		</div>
	);
}


export default ClassicalYTpage;
